import React, { useState } from 'react';
import axios from 'axios';

export function Navbar() {

    return(
        <div style={{display: 'flex', justifyContent: 'space-between', marginBottom: '20px',paddingBottom: '15px', paddingTop: '20px', backgroundColor: 'aliceblue'}}>
            <h3 style={{marginLeft: '50px'}}>
                Notes
            </h3>
            <column style={{marginTop: '6px'}}>
                <input type='text' size='40' style={{marginLeft: '20px', borderTopLeftRadius: '20px', borderBottomLeftRadius: '20px'}}/>
                <button type='button' style={{borderTopRightRadius: '20px', borderBottomRightRadius: '20px'}}>Search</button>
            </column>
            <text style={{marginRight: '50px', backgroundColor: 'LightCoral', padding: '6px', paddingTop: '6px', borderRadius: '4px'}}>Sign In</text>
        </div>
    );
}
